次世代の輝きを体感せよ！<br>
業界初車検対応LEDコンバージョンキット<br><br>

スフィアLEDは業界初の車検基準をクリアしたLEDコンバージョンキットです。<br>
発光チップにCREE社のXML2素子を採用。20Wの低消費電力ながら圧倒的な輝きを実現。しかも30,000時間の長寿命とエコロジーな製品。<br><br>

6000Kの白く美しい輝きはドレスアップとしてもギャラリーの目を引く。<br><br>

スフィアLED最大のポイントは、車検基準をクリアした業界初のLEDヘッドライトであること。<br>
ハロゲンバルブ仕様に基づいた緻密な照射角と発光点の設定。スフィアライト独自の集光技術による配光調整を行い、最高光度の正しい照射を実現しました。<br><br>
